    enum FlowerType
    {
        Роза,
        Хризантема,
        Пион,
        Ромашка,
        Тюльпан,
        Лилия,
        Колокольчик
    }
}

from project.player import Player

class Guild:

    def __init__(self, name: str):
        self.name = name
        self.players: [Player] = []

    def assign_player(self, player: Player):
        if player in self.players:
            return f"Player {player.name} is already in the guild."
        elif player.guild != "Unaffiliated":
            return f"Player {player.name} is in another guild."
        self.players.append(player)
        player.guild = self.name
        return f"Welcome player {player.name} to the guild {self.name}"

    def kick_player(self, player_name: str):
        player = [player for player in self.players if player.name == player_name]
        if not player:
            return f"Player {player_name} is not in the guild."
        player = player[0]
        player.guild = "Unaffiliated"
        self.players.remove(player)
        return f"Player {player_name} has been removed from the guild."

    def guild_info(self):
        data = [f"Guild: {self.name}"]
        data.extend(player.player_info() for player in self.players)
        return '\n'.join(data)

#PLAYER CLASS SOURCES

class Player:

    def __init__(self, name: str, hp: int, mp: int):
        self.mp = mp
        self.hp = hp
        self.name = name
        self.guild = "Unaffiliated"
        self.skills = {}

    def add_skill(self, skill_name: str, mana_cost: int):
        if skill_name in self.skills:
            return "Skill already added"
        self.skills[skill_name] = mana_cost
        return f"Skill {skill_name} added to the collection of the player {self.name}"

    def player_info(self, ):
        data = [f"Name: {self.name}",
                f"Guild: {self.guild}",
                f"HP: {self.hp}",
                f"MP: {self.mp}"]
        data.extend(f"==={skill_name} - {mana_cost}" for skill_name,mana_cost in self.skills.items())
        return '\n'.join(data)

