bool checkprime(int num) {
    bool isprime = true;
    int i = 0;

    if (num == 0 || num == 1) {
        isprime = false;
    }

/* Slower way
    for (i = 2; i <= num / 2; i++) {
        if ((num % i) == 0) {
            isprime = false;
        }
    }
*/

    for (i = 2; i <= sqrt(num); i++) {
        if ((num % i) == 0) {
            isprime = false;
        }
    }

    return isprime;
